EEC22E4579AB4E51A2B4547ACC429B9F	1004400000	es_ES	0	0	Y	2011-02-17 12:20:59.132554	0	2011-02-17 12:22:27.871914	0	Necesidad a Pedido	Crear un pedido de compra desde líneas de necesidad de material.	En la ventana Necesidad a Pedido es posible crear Pedidos de Compra desde las líneas de necesidad deseadas.La ventana está estructurada en 2 diferentes áreas. La superior para buscar necesidades abiertas. Y la segunda para las líneas de necesidad bloqueadas.Para buscar las líneas de necesiadad hay disponibles varios filtros. El check "Añadir líneas sin proveedor" es usado cuando para incluir líneas de necesidad que no tengan un proveedor asociado cuando se ha seleccionado uno en el filtro.La relación de las líneas de necesidad encontradas muestra líneas abiertas de necesidades que han sido completadas y que no están bloqueadas.Las líneas de necesidad que se pretenden utilizar para crear el Pedido de Compra han de ser seleccionadas en esta relación y añadidas al área inferior de bloqueo.En el área de bloqueo aparecen todas las líneas de necesidad bloqueadas por el usuario, aunque no cumplan los filtros del área superior. Las líneas de necesidad que hayan estado bloqueadas más de 3 días se consideran como desbloqueadas y no aparecerían en esta relación.Cada vez que se presiona el botón Crear se abre un popup para crear un único Pedido de Compra con todas las líneas necesarias según las líneas de necesidad que estén seleccionadas en el área de bloqueo. En la relación de líneas bloqueadas es posible cambiar la cantidad que se desea que se pida para cada línea de necesidad y es posible indicar el precio.	Y
